import React from "react";
import { MDBContainer, MDBRow, MDBCol, MDBJumbotron, MDBIcon } from "mdbreact";
import MenuLink from "./../components/menuLink";
import chanco from "./chanco.png"
const FormsNavPage = () =>  {

  return (

    <MDBContainer>

      <MDBRow>

        <MDBCol md="4" className="mt-3 mx-auto" img={  <img
         alt="chanco"

         src={chanco}
         style={{ height: '50rem', width: '50.5rem' }}
       />}>

          <MDBJumbotron>
            <h1>
              <MDBIcon icon="edit" className="green-text mr-2" />
              Registration
            </h1>
            <ul className="list-unStyled example-components-list">

              <MenuLink to="/forms/forms" title="Form" />

            </ul>
          </MDBJumbotron>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
}

export default FormsNavPage;
